import { useState } from "react";
import axios from "axios";
import { Button, Typography, Container, Box, Card, CardContent, Grid, Switch } from "@mui/material";

const API_URL = process.env.REACT_APP_API_URL || "http://localhost:5000";

const UploadForm = () => {
    const [realEstateFile, setRealEstateFile] = useState(null);
    const [techFile, setTechFile] = useState(null);
    const [carFile, setCarFile] = useState(null);
    const [useCarModel, setUseCarModel] = useState(false);
    const [loading, setLoading] = useState(false);
    const [finalResult, setFinalResult] = useState(null);

    const handleFileChange = (event, type) => {
        if (type === "real_estate") setRealEstateFile(event.target.files[0]);
        if (type === "tech") setTechFile(event.target.files[0]);
        if (type === "car") setCarFile(event.target.files[0]);
    };

    const handleUpload = async () => {
        const formData = new FormData();
        if (realEstateFile) formData.append("files", realEstateFile);
        if (techFile) formData.append("files", techFile);
        if (useCarModel && carFile) formData.append("files", carFile);
        
        formData.append("types", "real_estate");
        formData.append("types", "tech");
        if (useCarModel) formData.append("types", "car");

        setLoading(true);
        const response = await axios.post(`${API_URL}/predict/`, formData);
        setFinalResult(response.data);
        setLoading(false);
    };

    return (
        <Container>
            <Switch checked={useCarModel} onChange={() => setUseCarModel(!useCarModel)} />
            <Typography>Использовать авто-модель</Typography>
            <input type="file" onChange={(e) => handleFileChange(e, "real_estate")} />
            <input type="file" onChange={(e) => handleFileChange(e, "tech")} />
            {useCarModel && <input type="file" onChange={(e) => handleFileChange(e, "car")} />}
            <Button onClick={handleUpload}>Загрузить</Button>
        </Container>
    );
};

export default UploadForm;
